export default function SplashScreen() {

    return (
      <>
        <div className='text-center py-5 '>
          <Logo height="320" />
          <form action="/action_page.php" className=' formContainer'>
            <Input type='text' id="fname" placeholder='Email' image={<Email />} />
            <Input type='text' id="fname" placeholder='Username' image={<Username />} />
            <Input type='text' id="lname" placeholder='Password' image={<Password />} />
            <Button value='CREATE ACCOUNT' />
          </form>
        </div>
    
        </>
            
    );

};
